INSERT INTO `settings` VALUES (1,'عند استخدام خدمات I am fine، فإنك تأتمننا على معلوماتك لذا فإن المقصد من سياسة الخصوصية هذه مساعدتك على استيعاب ماهية البيانات التي نجمعها وسبب جمعنا لها والغرض الذي نستخدمها فيه. إن الامر هام، لذا نأمل أن تجد الوقت الكافي لقراءتها بعناية، ولا تنسَ أنه يمكنك العثور في حسابي على عناصر تحكم لإدارة معلوماتك وحماية خصوصيتك وأمانك.','When using I am fine services, you trust us, so the purpose of this privacy policy is to help you understand what data we collect, why we collect it, and what we use. This is important, so we hope you\'ll find time to read it carefully, and do not forget that you can find controls in my account to manage your information and protect your privacy and security.','خدمات میں ٹھیک ہوں استعمال کرتے وقت، آپ کو اس کی رازداری کی پالیسی کا مقصد آپ کیا ڈیٹا اکٹھا کرتے ہیں اور کیوں ہم نے یہ جمع کرتے ہیں اور اس مقصد سے ہم اس کا استعمال ہے جس کے لئے سمجھنے میں مدد کر سکتے ہیں تاکہ ہمیں آپ کی معلومات کے ساتھ پر اعتماد. یہ ضروری ہے، تاکہ ہم احتیاط سے ان کو پڑھنے کے لئے، اور آپ کو آپ کی معلومات کو منظم اور آپ کی پرائیویسی اور سیکورٹی کنٹرول کی حفاظت کے لئے اپنے اکاؤنٹ میں تلاش کر سکتے ہیں کہ نہیں بھولنا کافی وقت تلاش کرنے کے لئے امید ہے.','تتغير شروط الاستخدام من حين لآخر، وفي حالة إجراء مثل هذه التغييرات، سيعرض تطبيق أنا بخير إخطارات لكي يكون المُستخدِم على علم بها. استمرار المُستخدِم في استعمال تطبيق أنا بخير قائم على قبول شروط وأحكام الاستخدام هذه، حسب ما يجري تعديلها من وقت لآخر من أجل خدمة أفضل و جودة أعلى. أي مخالفة لهذه الاتفاقية من قبل العميل / المشترك قد تعرض حسابه للإيقاف بدون إشعار مسبق ودون استرجاع أي مبالغ في بعض الحالات.','Terms of use change from time to time, and if such changes are made, I will display fine notifications to make the user aware of them. User\'s continued use of the Application I am fine based on the acceptance of these terms and conditions of use, as amended from time to time for better service and higher quality. Any breach of this Agreement by Customer / Subscriber may be subject to suspension without prior notice and no refunds in some cases.','استعمال کی شرائط وقت وقت پر مختلف ہوتی ہیں، اور اس طرح کی تبدیلیوں کی صورت میں، درخواست اطلاعات میں ان سے آگاہ ہونے کے لئے ترتیب میں ٹھیک ہوں ظاہر کرے گا. درخواست کے مسلسل استعمال میں ٹھیک، ان استعمال کی شرائط و ضوابط کی منظوری پر مبنی ہوں وقت سے بہتر اور اعلی معیار کی خدمت کرنے کے لئے وقت پر ترمیم شدہ. کلائنٹ / سبسکرائبر اکاؤنٹ کی طرف سے اس معاہدے کی خلاف ورزی پیشگی اطلاع کے بغیر اور کچھ معاملات میں کسی بھی مقدار کی بازیابی کے بغیر معطل کردیا گیا ہے.',NULL,'2017-08-24 13:39:34');
